// import { Fragment } from 'react';
// import styled,{css} from "styled-components";
// import './App.css';

const bucketItems = [
  "세계 일주 여행",
  "스카이 다이빙",
  "오로라 구경하기",
  "마라톤 완주"
];

const App = () => {
  const buketList = bucketItems.map((bucketItem,index) => <li key={index}>{bucketItem}</li>);
  return(
    <>
    <h1>버킷리스트</h1>
    <ul>{buketList}</ul>
    </>
  )
};

export default App;
